class JLanguage{constructor(){$(document).on("click",".dropdown-language",t=>{t.preventDefault(),this.change(t.target.text.trim())})}translate(t){var e=JSON.parse(sessionStorage.getItem($_.document.lang));return e?e[t]:t}change(t){$_.http.request("/language/"+t,(e,a)=>{var n=JSON.parse(sessionStorage.getItem(t))||null;e&&console.log(e),"en"!==t&&null===n&&sessionStorage.setItem(t,JSON.stringify(a.data)),window.location.href=""})}}